        super(props) 
        this.state={
            name:'ss'
        }
    }
 changeState=(value)=> {this.setState({name: value})}

    render() {
        return(
            <div>
            <ChildA dspName={this.state.name} />
            <ChildB value={this.state.name} changeName={this.changeState}  />
            </div>
        )
    }


}

